import Sidebar from './Sidebar';
import Main from '.'

function App() {
  return (
    <div className='mx-auto min-h-screen max-w-screen-xl px-6 py-12 md:px-12 md:py-20 lg:px-24 lg:py-0'>
      <div className='lg:flex lg:justify-between lg:gap-4'>
        <Sidebar />
        <Main />
      </div>
    </div>
  );
}

export default App;
